('1320','18','7235','Villa Morten A',Null,'Großzügige Luxusvilla in begehrter Villenwohnlage in Alt-Bendinat','10148','Dieses großzügige Anwesen befindet sich in bevorzugter und unvergleichlicher Lage auf einem Gartengrundstück von 1371 m², direkt an der kleinen Sandbucht von Alt-Bendinat. Die Villa ist mit 528 m² Wohnfläche wie folgt aufgeteilt: Eingangsbereich mit Treppe zum Wohnzimmer und Zugang zu den überdachten Terrassen, Esszimmer, Luxusküche, Hauswirtschaftsraum, Gartentreppe zum Poolbereich, von dem man einen wunderschönen Meerblick genießen kann. Im Untergeschoss befinden sich die 6 Schlafzimmer mit Bädern, der Aufzug verbindet die Wohnebenen mit der großzügigen Garage für 3 Autos. Beste Bauqualität und Materialien runden das Angebot ab.','10149','3950000','106','2009-09-02 13:00:05','106','2009-09-02 13:01:55',Null,'496','72','272',1,'1','0',Null,Null,Null,'10150',Null,'0','0','0',Null,'2015-10-16 09:38:37',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'10151',Null,'10152',Null,'10153',Null,'10154','Gabi 678515171','10155','0',0,'0');
